<!DOCTYPE html>
<html>
  <head>
    <title>Phlico Main</title>
    <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
    <meta http-equiv="content-type" content="text/html; charset=utf-8"/>
    <meta name="apple-mobile-web-app-capable" content="yes"/>
    <link href="resources/css/jquery-ui-themes.css" type="text/css" rel="stylesheet"/>
    <link href="resources/css/axure_rp_page.css" type="text/css" rel="stylesheet"/>
    <link href="data/styles.css" type="text/css" rel="stylesheet"/>
    <link href="files/phlico_main/styles.css" type="text/css" rel="stylesheet"/>
    <script src="resources/scripts/jquery-1.7.1.min.js"></script>
    <script src="resources/scripts/jquery-ui-1.8.10.custom.min.js"></script>
    <script src="resources/scripts/prototypePre.js"></script>
    <script src="data/document.js"></script>
    <script src="resources/scripts/prototypePost.js"></script>
    <script src="files/phlico_main/data.js"></script>
    <script type="text/javascript">
      $axure.utils.getTransparentGifPath = function() { return 'resources/images/transparent.gif'; };
      $axure.utils.getOtherPath = function() { return 'resources/Other.html'; };
      $axure.utils.getReloadPath = function() { return 'resources/reload.html'; };
    </script>
  </head>
  <body>
    <div id="base" class="">

      <!-- container (Rectangle) -->
      <div id="u0" class="ax_default box_1" data-label="container">
        <div id="u0_div" class=""></div>
      </div>

      <!-- baseImage (Image) -->
      <div id="u1" class="ax_default image" data-label="baseImage">
        <img id="u1_img" class="img " src="images/phlico_main/baseimage_u1.jpg"/>
      </div>

      <!-- Footer (Group) -->
      <div id="u2" class="ax_default" data-label="Footer" data-left="11" data-top="415" data-width="479" data-height="70">

        <!-- userProfile (Ellipse) -->
        <div id="u3" class="ax_default image" data-label="userProfile">
          <img id="u3_img" class="img " src="images/phlico_main/userprofile_u3.png"/>
        </div>

        <!-- commentsIcon (Shape) -->
        <div id="u4" class="ax_default icon" data-label="commentsIcon">
          <img id="u4_img" class="img " src="images/phlico_main/commentsicon_u4.png"/>
        </div>

        <!-- likeIcon (Shape) -->
        <div id="u5" class="ax_default icon" data-label="likeIcon">
          <img id="u5_img" class="img " src="images/phlico_main/likeicon_u5.png"/>
        </div>

        <!-- closeIcon (Shape) -->
        <div id="u6" class="ax_default icon" data-label="closeIcon">
          <img id="u6_img" class="img " src="images/phlico_main/closeicon_u6.png"/>
        </div>
      </div>
    </div>
